import React from 'react';
import { Dropdown, DropdownButton } from 'react-bootstrap';

const FoodList = ({ foods }) => {
    return (
        <ul className="list-unstyled row">
            {foods.map((food) => (
                <li key={food._id} className="col-12 col-md-4 mb-4">
                    <div className="card card-couser-item">
                        {food.image && (
                            <img src={food.image} className="card-img-top" alt={food.name} width="150" height="160" />
                        )}
                        <div className="card-body">
                            <h5 className="card-title underline-none">{food.name}</h5>
                            <p className="description card-text">{food.price}</p>

                            {/* Dropdown for food actions */}
                            <DropdownButton id="dropdown-basic-button" title="Options">
                                <Dropdown.Item href={`/foods/${food._id}`}>View Details</Dropdown.Item>
                                <Dropdown.Item href="/Foods/manager">Đăng ký</Dropdown.Item>
                            </DropdownButton>
                        </div>
                    </div>
                </li>
            ))}
        </ul>
    );
};

export default FoodList;
